import React from 'react';
import backgroundImage from '../path-to-your-background-image.jpg'; // Adjust path as necessary

function Header() {
  return (
    <header 
      className="bg-cover bg-center h-96 text-white py-24 px-10" 
      style={{ backgroundImage: `url(${backgroundImage})` }}>

      <h1 className="text-4xl font-bold mb-2">Welcome to Our Site</h1>
      <p className="mb-4">Discover the amazing world of Tailwind CSS</p>
      <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
        Get Started
      </button>
    </header>
  );
}

export default Header;
